/*!50003 CREATE*/ /*!50017 DEFINER=`chrispug_pricetr`@`73.186.32.77`*/ /*!50003 TRIGGER `new_item_calc_price_stuff` AFTER INSERT ON `Items` FOR EACH ROW BEGIN
			    
        
		update `CurrentPrices` INNER JOIN Items ON Items.id = CurrentPrices.id SET  `price_per_liter` = pricePerLiter(
		CurrentPrices.sale_price,
		CurrentPrices.price,
		Items.volume
		),`price_per_abv`=pricePerABV(Items.proof,CurrentPrices.sale_price,CurrentPrices.price,Items.volume) ,
		`the_min`= CASE WHEN  CurrentPrices.sale_price <  CurrentPrices.price
				   THEN  CurrentPrices.sale_price 
				   ELSE  CurrentPrices.price
					END
		WHERE CurrentPrices.id =NEW.id;
        
        -- 'update CurrentPrices as p1,(\n			SELECT \n					mt1.price_id as q,( mt1.the_min - mt2.the_min\n					) / mt1.the_min *100\n					AS real_perc_diff\n					FROM Prices mt1\n					LEFT JOIN Prices mt2 ON mt2.scrape_date = ( \n					SELECT MAX( mt3.scrape_date ) \n					FROM Prices mt3\n					WHERE mt3.id = mt1.id\n					\n					AND mt1.price_id != mt3.price_id\n					AND mt3.scrape_date < mt1.scrape_date ) \n					WHERE mt2.id = mt1.id ) as p2\n			 set p1.perc_diff = p2.real_perc_diff\n			where p2.q = p1.price_id and p1.id=NEW.id;'
        
        UPDATE `CurrentPrices` SET avg_dif_perc=(CurrentPrices.the_min-avgPrice(CurrentPrices.id))/CurrentPrices.the_min*100 WHERE CurrentPrices.id =NEW.id;  

    END */;;
